import React,{useState,useEffect} from 'react'
import Fetch from './Fetch'
import './Data.css'

function Data() {


const [data,setdata]=useState([])


useEffect(()=>{
    fetchdata()
},[])


async function fetchdata()
{
    await Fetch.getdata().then(res=>{
        setdata(res)
    })
    .catch((err)=>{console.log(err)})
}

  return (
    <div className='data'>
    
        <table>
        <tbody>
            <tr>

            <th>First Name</th>
            <th>Last Name</th>
            <th>Date</th>
            <th>Rank</th>
            <th>Gender</th>
            <th>Actions</th>
            </tr>

            {
                data?(data.map((val)=>(
                    <tr key={val._id}>
                        <td>{val.first_name}</td>
                        <td>{val.last_name}</td>
                        <td>{val.date.toISOString()}</td>
                        <td>{val.rank}</td>
                        <td>{val.gender}</td>
                        <td><button onClick={()=>{alert(val.first_name)}}>EDIT</button>
                        <button>DELETE</button></td>
                    </tr>
                ))):<></>
            }
            </tbody>
        </table>
    </div>
  )
}

export default Data
